import{_ as t,o as e,c as a,O as o}from"./chunks/framework.9482e208.js";const p=JSON.parse('{"title":"§ 33.2-291 Local authorities subordinate to Authority.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/33.2-291.md","filePath":"vacode/33.2-291.md"}'),r={name:"vacode/33.2-291.md"},i=o('<h1 id="§-33-2-291-local-authorities-subordinate-to-authority" tabindex="-1">§ 33.2-291 Local authorities subordinate to Authority. <a class="header-anchor" href="#§-33-2-291-local-authorities-subordinate-to-authority" aria-label="Permalink to &quot;§ 33.2-291 Local authorities subordinate to Authority.&quot;">​</a></h1><p>Any conflict between any authority granted to localities or other entities of the Commonwealth, other than the Transportation Board and the Department, with respect to the ownership or use of rail facilities or the provision of passenger rail service, or the exercise of that authority, and the exercise of the authority granted by the Board under this article shall be resolved in favor of the exercise of such authority by the Board. Rights-of-way transferred to the Authority from a railroad shall not be subject to the requirements of any local ordinances enacted pursuant to Chapter 22 (§ <a href="/vacode/15.2-2200/">15.2-2200</a> et seq.) of Title 15.2.</p><p>2020, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP1230" target="_blank" rel="noreferrer">1230</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP1275" target="_blank" rel="noreferrer">1275</a>.</p>',3),n=[i];function s(h,c,l,d,u,f){return e(),a("div",null,n)}const b=t(r,[["render",s]]);export{p as __pageData,b as default};
